                    <string>최종 사용자 라이선스 계약

필독사항 – 자세히 읽어주십시오: 본 &lt;최종 사용자 라이선스 계약&gt; (이하 &lt;계약&gt;)은 귀하(자연인, 법인 또는 기타 조직)와 난징 Fineres 소프트웨어 회사간의 난징 Fineres 소프트웨어의 FineReport 소프트웨어 제품(이하 ‘소프트웨어 제품’)에 관한 법률 계약입니다. 본 ‘소프트웨어 제품’은 컴퓨터 소프트웨어를 포함하며, 관련 미디어와 인쇄 자료 및 ‘관련’ 또는 전자 파일(‘소프트웨어 제품’)도 포함할 수 있습니다. 본 ‘소프트웨어 제품’은 난징 Fineres 소프트웨어 회사가 귀하에게 제공한 기존 ‘소프트웨어 제품’의 모든 업데이트와 보충자료도 포함합니다. 본 ‘소프트웨어 제품’과 함께 제공되는 단독 최종 사용자 라이선스 관련 소프트웨어 제품은 라이선스 계약 상의 조항에 의거하여 귀하에게 제공됩니다. 설치・복사・다운로드・접근 또는 기타 방식으로 ‘소프트웨어 제품’을 사용하면 귀하다 본 &lt;계약&gt;의 각 조항에 동의함을 의미합니다. &lt;계약&gt; 상의 조항에 동의하지 않을 경우 ‘소프트웨어 제품’을 설치 및 사용하지 말아주십시오. 단, 구매처에 반품할 수 있으며 전액을 환불 받을 수 있습니다. 

소프트웨어 제품 라이선스
본 ‘소프트웨어 제품’은 저작권법과 국제 조약 조항 및 기타 지식재산권법과 조약의 보호를 받습니다. 본 ‘소프트웨어 제품’은 허가에만 사용되며 판매하지 않습니다. 

Ⅰ. 라이선스의 부여
본 &lt;계약&gt;은 귀하에게 다음과 같은 권리를 부여합니다. 
