Ⅲ. 등록과 미등록 구별
Report 서버의 등록 여부 확인의 두 가지 방법: 한 가지는 엔지니어링을 배치한 후 관리 플랫폼에 등록하는 것입니다. http://IP:포트/Report 애플리케이션 이름/ReportServer?op=fr_platform（IP, 포트와 애플리케이션 이름 은 사용자 Web 애플리케이션 서버와 Report 애플리케이션 이름을 다시 정의）은 서버 설치&gt;등록정보&gt;버전정보를 클릭하면 현재 들어가 있는 서버의 등록 여부를 확인할 수 있습니다. 또 다른 방법은 엔지니어링 배치 후 브라우저에 로그인 하여 주소를 입력하는 것입니다：http://IP:포트/Report 애플리케이션 이름/ReportServer?op=fr_reg

Fineres Report 공식 홈페이지에서 다운로드 및 업로드한 FineReport 소프트웨어는 미등록 버전입니다. 사용자의 Report 기능 테스트의 편의를 위해 등록되지 않은 버전도 모든 기능을 포함하고 있지만 다음과 같은 문제가 발생할 수 있습니다. 
1. Report 열기
본 지역에서 원격 서버의 Report에 접속할 때 Report의 왼쪽 하단 모서리에 다음과 같은 하이퍼링크의 파란색 글자가 나타날 수 있습니다. FineReport 기업버전을 구매해 주십시오 – 등록
2. 알림 정보
본 지역에서 원격 서버 상의 Report에 접속할 때 Fineres Report 공식 홈페이지에 가끔 자동 접속이 되는 경우가 있으며 다음과 같이 쓰여진 파란색의 구매 등록 페이지가 나타날 수 있습니다. 
Fineres Report의 라이선스를 구매 또는 업데이트해 주십시오. 

귀하가 본 화면으로 넘어 온 것은 기한이 만료된 라이선스를 발견했거나 귀하가 귀하의 사용 허가 범위 안에 있지 않은 사용자이기 때문입니다. 
Fineres Report 공식 홈페이지에서 라이선스를 구매 또는 업데이트 해 주십시오. 감사합니다. 

3. 일괄 발송 제한
미등록 버전의 Fineres Report 제한 일괄 방송 수는 2이며, 2개의 클라이언트단만 서버에 접속할 수 있고, 이는 귀하의 작업에 큰 영향을 줄 수 있습니다. 

4. 내장 서버
미등록 버전은 7일에 한번 Web 응용 서버의 작동을 일시적으로 멈추게 하여 Report 접속 불가를 초래할 수 있습니다. 이때 Tomcat와 같은 Web 응용 서버를 실행해야 합니다. 
Ⅳ. 업그레이드 버전
본 ‘소프트웨어 제품’이 난징 Fineres 소프트웨어 회사나 또 다른 공급업체의 별도의 제품 업데이트 버전에 속할 경우 본 &lt;계약&gt;에 따라서만 버전 업데이트를 할 수 있습니다. 본 ‘소프트웨어 제품’이 소프트웨어팩 중 한 구성요소의 업데이트 버전이고, 귀하의 해당 소프트웨어팩의 라이선스 계약에서 이를 단일 제품으로 간주할 경우 귀하는 본 ‘소프트웨어 제품’을 이 소프트웨어팩에서만 사용 및 양도할 수 있고, 여러 대의 컴퓨터에서 나누어 사용할 수 없습니다. 

Ⅴ. 저작권
본 ‘소프트웨어 제품’(본 ‘소프트웨어 제품’에 포함되어 있는 모든 이미지, 사진, 애니메이션, 녹화영상, 녹음, 음악, 텍스트 및 부가 프로그램 포함)과 첨부된 인쇄 자료 및 ‘소프트웨어 제품’의 모든 복사본의 재산권과 저작권은 난징 Fineres 소프트웨어 회사의 소유입니다. 본 ‘소프트웨어 제품’은 저작권법과 국제 공약 조항의 보호를 받습니다. 귀하는 본 ‘소프트웨어 제품’을 자작권이 있는 자료와 동일하게 대해야 합니다. 단, 다음과 같은 상황은 예외로 합니다. a) 백업 또는 파일링을 목적으로 하는 원본의 저장. b) 한 대의 컴퓨터에 본 ‘소프트웨어 제품’을 설치할 수 있지만 본 ‘소프트웨어 제품’에 첨부 되어 있는 인쇄 자료를 복사해서는 안 됩니다. 
Ⅵ. 멀티미이어 소프트웨어
귀하는 멀티미디어를 통해 ‘소프트웨어 제품’을 얻을 수 있습니다. 유형과 크기를 떠나 모든 미디어에 대해 귀하의 단일 컴퓨터에 적용된 미디어만 사용할 수 있습니다. 귀하는 또 다른 컴퓨터에서 또 다른 종류의 미디어를 실행할 수 없습니다. ‘소프트웨어 제품’ 이 영구적으로 양도된 부분(상기 내용에 명시)을 제외하고, 귀하는 또 다른 미디어를 대여・임대 및 빌리거나 기타 다른 방식으로 또 다른 사용자에게 이전시킬 수 없습니다. 
Ⅶ. 복사본 백업
본 &lt;계약&gt;에 따라 본 ‘소프트웨어 제품’ 복사본을 설치한 후 귀하는 난징 Fineres 소프트웨어 회사가 귀하에게 ‘소프트웨어 제품’ 제공용으로 사용한 원 미디어를 남겨둘 수 있으며 백업이나 파일링으로만 사용해야 합니다. 본 &lt;계약&gt;에 명문화된 규정이 있는 경우를 제외하고 귀하는 본 ‘소프트웨어 제품’ 또는 첨부로 따라 오는 ‘소프트웨어 제품’의 인쇄 자료를 복사해서는 안 됩니다. 
Ⅷ. 손해 배상 책임 면책
관련 법률에서 허용하는 최대 범위 안에서 난징 Fineres 소프트웨어 회사나 그 공급업체는 본 소프트웨어 제품을 사용하지 못해 발생한 손해(영업 이익 손실, 영업 중단, 영업 정보 유실, 데이터나 코드 손상, 프로그램 실행 오류 등)에 대한 배상책임을 지지 않습니다. 난징 Fineres 소프트웨어 회사가 사전에 해당 손해의 발생 가능성을 고지 받았어도 마찬가지 입니다. 어떠한 상황에서도 난징 Fineres 소프트웨어 회사는 모든 조항에 대해 책임을 져야 하는 책임 총액이 귀하가 해당 ‘소프트웨어 제품’에 실질적으로 지불한 금액을 넘지 않습니다. 
